import React from 'react'
import s from './FriendsOnline.module.css'

const FriendsOnline = (props) => {

    let FriendsOnline = props.FriendsOnline.map( friendOnline => {
        return <FriendsOnline name={friendOnline.name}
                              gen={friendOnline.gen}
                              img={friendOnline.img}/>
    })

    return (
        <aside className={s.profile_aside}>
            <div className={s.friends_online}>
                <span>Друзья онлайн:</span>

                { FriendsOnline }
            </div>
        </aside>
    )
}

export default FriendsOnline
